import React, { Component } from "react";
import { connect } from "react-redux";
class Dashboard extends Component {
  render() {
    let tdStyle = { boxShadow: "0 .125rem .25rem rgba(0,0,0,.075) !important" };
    let thtdStyle = { background: "white" };
    console.log("[Dashboard Render]", this.props);
    return (
      <table className="table">
        <thead>
          <tr>
            <th style={thtdStyle}>Category</th>
            <th style={thtdStyle}>Item name</th>
            <th style={thtdStyle}>Amount</th>
            <th style={thtdStyle}>Expense date</th>
            <th style={thtdStyle}>Action</th>
          </tr>
        </thead>
        <tbody>
          <tr style={tdStyle}>
            <td>Grocery</td>
            <td>Bread</td>
            <td>40</td>
            <td>23 04 2019</td>
            <td>
              <i class="fas fa-pen" /> | <i class="fas fa-trash-alt" /> |
              <i class="fas fa-undo" />
            </td>
          </tr>
          <tr>
            <td>Grocery</td>
            <td>Bread</td>
            <td>40</td>
            <td>23 04 2019</td>
            <td>
              <i class="fas fa-pen" /> | <i class="fas fa-trash-alt" /> |
              <i class="fas fa-undo" />
            </td>
          </tr>
        </tbody>
      </table>
    );
  }
}

const mapStateToProps = state => {
  console.log("[State]", state);
  return state;
};
export default connect(mapStateToProps)(Dashboard);
